(()=>(a,e)=>{const n=new Map([["useDefaultPlayerLayout",`デフォルト・プレーヤー・レイアウトを設定する. できるだけ、適切なページに設定（例えば、番組の放送ページに番組プレーヤーのレイアウトを設定する）、そうでない場合は効果がない可能性があります.\n- 旧版: 伝統的なレイアウト\n- 新版: 動画ページに黙認の新版レイアウト\n注意: 伝統的なレイアウトでは、多くのスクリプト機能が適用されない.`],["defaultPlayerLayout",`動画プレーヤーのレイアウトを設定する.`],["defaultBangumiLayout",`番組プレーヤーのレイアウトを設定する.`],["useDefaultPlayerMode",`デフォルト・プレーヤー・モードが使用するかどうかを制御する、 例えば<span>常规</span>、<span>宽屏</span>、 <span>网页全屏</span>か<span>全屏</span>.`],["defaultPlayerMode",`デフォルト・プレーヤー・モードが設定する.`],["applyPlayerModeOnPlay",`再生時にモードを適用する、「いいえ」を選択すると、再生が開始されていないときに適用されます.`],["autoLightOff",`初回放送時には、自動的に消灯モードに入り、再生終了後に自動的に点灯します.`],["useDefaultVideoQuality",`動画を開くときに指定された画質を自動的に選択する. 映像の最高画質が選択された画質より低ければ、映像の最高画質を使用する.`],["defaultVideoQuality",`自動的に選択された映像画質を設定する.`],["useDefaultDanmakuSettings",`デフォルトで弾幕を開くかどうかを設定する.そして、「防挡字幕」と「智能防挡弹幕」を覚えておくかどうかを設定できる.`],["enableDanmaku",`弾幕がデフォルトで開くかどうかを制御する.`],["rememberDanmakuSettings",`弾幕ブロックの設定を覚えるかどうかを制御する、「防挡字幕」と「智能防挡弹幕」を含まれています.これらの設定を動画制御欄で変更すると、すべでの動画にデフォルトでこれらの設定が使用されます.`],["expandDanmakuList",`新版レイアウトでは、他のおすすめ動画が表示されるようにデフォルトで弾幕リストが折りたたまれています.この機能を有効にすると、動画が読み込まれるたびに弾幕リストが自動的に展開されます.`],["expandDescription",`長すぎる動画概要欄はデフォルトで折りたたまれています、この機能を有効にすると完全な動画概要欄が強制的に展開されます.`],["autoContinue",`動画再生時に視聴履歴が検出されると(<span>前回の见た...</span>情報)、自動的に対応する時間に再生される.`],["allowJumpContinue",`履歴のセット数が現在開いているページと矛盾している場合でも、自動的にジャンプします.`],["autoPlay",`動画ページに入ると、自動的に動画の再生が開始されます.`],["skipChargeList",`エンディングの「充电鸣谢」を自動スキップ.`],["framePlayback",`プレーヤーの時間に右側に2つのボタンが追加されました.動画の時間を細かく調整するために使用される. キーボードショートカットに対応します<kbd>Shift</kbd>+<kbd>←</kbd>/<kbd>→</kbd>. (伝統的なレイアウトでキーボードショートカットのみ使用でき、ボタンは表示されません)`],["videoScreenshot",`プレーヤーの時間に右側に1つのボタンが追加されました.動画スクリーンショットを使用されます. キーボードショートカットに対応します<kbd>Ctrl</kbd>+<kbd>Alt</kbd>+<kbd>C</kbd>. (伝統的なレイアウトでキーボードショートカットのみ使用でき、ボタンは表示されません)`],["playerFocus",`動画/番組の放送ページに入る時、プレーヤーに自動的に移動する.`],["playerFocusOffset",`移動時の垂直オフセット、単位はピクセル(px).`],["outerWatchlater",`動画放送ページの<span>稍后再看</span>を外に移動します.`],["keymap",`動画プレーヤーのためにより多くのショートカットを有効にします:\n- <kbd>w</kbd> ウェブの全画面\n- <kbd>t</kbd> ワイドモード\n- <kbd>m</kbd> 消音\n- <kbd>d</kbd> 弾幕スイッチ\n- <kbd>l</kbd> いいね\n- <kbd>c</kbd> コインを投げる\n- <kbd>s</kbd> お気に入り\n- <kbd>j</kbd> 85秒進みます\n- <kbd>p</kbd> 画中画を切り替えます\n- <kbd>\`</kbd> プレーヤーメニューを開きます\n- <kbd>Shift + j</kbd> 85秒後退する\n- <kbd>Shift + w</kbd> 後で見る\n- <kbd>Shift + ↑/↓</kbd> / <kbd>Shift + ,/.</kbd> 再生速度を調整する\n- <kbd>Shift + /</kbd> 再生速度をリセットする`],["doubleClickFullscreen",`ダブルクリックして全画面に切り替えることができます.ご注意ください<span>播放器触摸支持</span> - <span>启用双击控制</span>と共に使用できない.`],["customStyleColor",`頂欄(スタイルの調整が有効な場合）と夜間モードのテーマ色で埋める、カラープレビューサークルをクリックして、设定の16種類のテーマカラーにできるの、右側のテキストボックスに任意の有効な16進数のカラー値を直接入力することもできます.(<span>#rrggbb</span>或<span>#rgb</span>).`],["blurBackgroundOpacity",`设置顶栏对横幅的透明度(0~1), 数值越高顶栏越淡, 当横幅关闭时此选项无效.`],["customNavbar",`カスタム頂欄を使用する.伝統的な頂欄に取って代わる.メインステーション専用です.「生放送」、「アルバム」、「会員購」などには影響しません.`],["customNavbarSeasonLogo",`通常のロゴの代わりに季節のロゴを使用するかどうか.`],["customNavbarFill",`テーマ色で頂欄を埋める.`],[`customNavbarTransparent`,`トップの横断幕が存在する場合は、背景の透明効果を使用します.`],["customNavbarShadow",`頂欄に投影効果を追加する.`],["customNavbarCompact",`トップページにコンパクトなレイアウトを使する.コンパクトなレイアウトはより小さなスペースを使用し、そして動画のタイトルが長すぎる場合に後者の部分を省略するための 「...」を使用する.`],["customNavbarBlur",`トップの横断幕が存在する場合は、背景のぼかし効果を使用します.`],["useDarkStyle",`夜間モードでは、ページの明るい部分が暗い色に変わり、夜間の視聴に最適な表示になります.そして多くのテーマカラーを適用します.ぜひお試しください.`],["darkSchedule",`夜間モードを使用して计画タイムを設定する.この期間を開始または終了すると、夜間モードは自動的にオンまたはオフになり、終了時刻は開始時刻より短く、翌日と見なされます.例えば<span>18:00</span>から<span>6:00</span>夜の18：00から翌日の6：00までを表しています.`],["darkScheduleStart",`計画期間の開始時刻を設定する.`],["darkScheduleEnd",`計画期間の終了時刻を設定する.`],["compactLayout",`ホームページでコンパクトレイアウトを使用するかどうかを設定します.動画の間隔が狭くなり、フィレットが切り取られ、カテゴリ欄のアイコンは高解像度版を使用します.`],["useCommentStyle",`- 人気コメントのアバターの下にある「フォロー」ボタンを削除します\n- ユーザーの「レベル」アイコンの削除します\n- 発送端末の情報を削除(例えば<span>来自安卓客户端</span>)\n- 送信時刻は右上に移動します\n- ビットアイコンはすべてベクトルアイコンを入れ替えており、高解像度の画面はぼやけません．\n注釈:「フォロー」と「レベル」アイコンはマウスでアバタ上に置くことで，ポップアップした資料カードに表示することができる.`],["simplifyLiveroom",`- 「老爷」アイコンを隠す\n- 「入場通知」を隠す\n- 「ファン勲章」アイコンを隠す\n- 「活動肩書き」アイコンを隠す\n- 「弾幕特殊効果」を隠す\n- 「全域放送」を隠す\n- 「ウェルカムメッセージ」を隠す (例えば、「xxx老爷进入直播间」)\n- 「ギフト弾幕」を隠す (弾幕リストのみ. 例えば「节奏风暴」など特殊効果は影響を受けません)\n- 「艦長購入のヒント」を隠す (弾幕リストの「xxxは艦長を購入する」)\n- 「有料ギフト」を隠す (プレーヤーの下でのさまざまな有料ギフト欄)\n- 「入場特殊効果」を隠す\n- 「看板娘」を隠す\n- 「イベント横断幕」を隠す\n- 「ランキング」を隠す\n- 「抽選のヒント」を隠す (例えば、「艦長」を購入する時、「小飞船」を購入する時、ギフトを抽選のヒント)\n- 「PKウィンドウ」を隠す\n- 「高エネルギーリストのヒント」を隠す\n- 配信ルームの「特殊な背景」を無効にする（ダークテーマでは、デフォルトでは「特殊な背景」も無効になっています）\n各項目は、非表示にするかどうかを<span>附加功能</span>の中で個別に選択することができる.`],["hideBanner",`トップページの横断幕を非表示.`],["playerShadow",`プレーヤーにテーマカラーの投影の追加する.`],["narrowDanmaku",`ウェブの全画面表示されている場合は、幅が狭すぎても弾幕欄を強制的に保持し.この場合には右側の機能ボタンが境界線を押し出してしまう可能性があることに注意する.`],["blurVideoControl",`動画制御欄の背景をぼかします.伝統的な陰影効果は無効になります.`],["customControlBackground",`動画制御欄に半透明な黒を付ける、伝統的な陰影効果を置き換える.`],["customControlBackgroundOpacity",`制御欄に黒の不透明度（0～1）を設定し、数値が大きくなるほど黒が濃くなるように設定します.`],["harunaScale",`スクリーンDPIによって、配信ルームの看板娘のサイズをスケーリングして、ピクセルの解像度を高めます.`],["removeLiveWatermark",`生放送時、隅の透かしを削除する.`],["removeVideoTopMask",`マウスが通過したら、動画の右上隅にあるタイトル層を削除します.`],["hideOldEntry",`放送ページの右側<span>返回旧版</span>を隠す.`],["hideBangumiReviews",`番組ページの採点区を隠す.`],["hideCategory",`ホームページのエリア欄を隠す、それでもエリア欄は頂欄のホームメニューからアクセスできます.`],["removeAds",`ビリビリのさまざまな広告を削除する.ホームページのプロモーションモジュール、モバイルアプリのおすすめ、動画ページの右側にある広告などが含まれます.`],["watchLaterRedirect",`「後で見る」のリンクを通常の再生ページに変更して、新版レイアウトの再生ページを使用する.可以分别选择是否重定向顶栏和稍后再看页面.`],["favoritesRedirect",`個人センターの「お気に入り」の動画を通常の再生ページに変更して、「お気に入り」再生の放送ページではなく.`],["hideTopSearch",`検索欄の推薦語を<span>搜索</span>に置き換える.`],["fullTweetsTitle",`頂欄のフィードプレビューページでは、常に完全なタイトルが展開されます.`],["fullPageTitle",`動画選集リストですべでを展開し、タイトルが1行を超えたら、別の行を開始して完全なタイトルを表示します.`],["showDeadVideoTitle",`個人センターの中に、失効した動画のタイトルとサムネイルを復元する.`],["useBiliplusRedirect",`失効した動画のリンクを「BiliPlus」ページに変更して.`],["deadVideoTitleProvider",`失効した動画の情報源: 「後で見る」は安定していますが、少し時間がかかります; 「BiliPlus」のスピードは速いですが、書き残していますので、しばらく開けません.`],["biliplusRedirect",`動画、番組、個人センターページで、追加機能<span>转到BiliPlus</span>をクリックして、BiliPlusの対応するページに移動します.`],["imageResolution",`スクリーンDPIによって、より高い解像度の画像を読み込む.（例えば、スクリーンのDPIが200％に調整されている場合、解像度は2倍になり、読み込み時間は長くなります.)`],["oldTweets",`「新版のフィード」リンクを 「旧版のフィード」に置き換え、追加機能で 「新版のフィード」/「旧版のフィード」を切り替えます.`],["i18n",`インタフェースの一般的なテキストの翻訳を提供する.`],["i18nLanguage",`翻訳言語`],["noLiveAutoplay",`生放送のホームページのおすすめライブルームで自動的に再生を開始することは禁止されています.`],["hideHomeLive",`生放送のホームページのおすすめライブルームを隠す.`],["foldComment",`フィードページにコメントを表示しているときに下部に「コメントを閉じる」ボタンを追加します.`],["seedsToCoins",`追加機能に<span>瓜子换硬币</span>ボタンを追加し、クリックして1日に1回に制限されて、1コインに700銀ヒマワリの種を交換してください.`],["touchNavBar",`頂欄の右側の1級リンクを削除します(<span>大会員</span>から<span>履歴</span>まで).タッチスクリーンデバイスですばやく情報を便利にします.削除されたリンクページはそれぞれのプレビューの中から<span>查看更多</span>に入ることができます.`],["comboLike",`「おすすめ三連」（「いいね」を長押した）のタッチサポートを有効にする.`],["touchVideoPlayer",`制御欄のボタン間隔を大きくして、タッチ操作をより正確にする.プレーヤーのタッチサポートを有効にする:\n- 左右にスワイプして再生の進行状況を調整します\n- 上下にスワイプして音量を調整します\n- 進行状況の調整は左上と右上でキャンセルできます\n- 異なる位置にスワイプすると、3つの異なる感度を使用できます.`],["touchVideoPlayerAnimation",`タッチ調整のヒントボックスにアニメーションの表示と非表示のどうかを決定します.このアニメーションはフレームがドロップされる可能性があります.`],["touchVideoPlayerDoubleTapControl",`操作方法を変更する.クリック:制御欄を表示/非表示, ダブルクリック放送/一時停止.`],["toast",`ウェブページの左下隅に表示スクリプトからのメッセージ、例えば更新通知の送信、エラーメッセージなどです.`],["toastInternalError",`オープンしたら、エラーメッセージは詳細な技術的エラー情報とスタック追跡を表示します.これは通常問題発生の原因を正確に確定するために使用されます.だから、問題を報告する時にこれらの情報はとても役に立ちます.`],["useCache",`スクリプトの読み込み速度を上げるためにキャッシュを使う.`],["filenameFormat",`ファイルの命名形式をカスタマイズする、<span>下载弹幕</span>、<span>下载视频</span>、<span>视频截图</span>、<span>查看封面</span>に作用する.\n使用できる変数は:\n- <span>title</span>: 動画のタイトル/配信ルームのタイトル\n- <span>ep</span>: エピソードタイトル\n- <span>aid</span>: AV番号 (動画アドレス番号)\n- <span>cid</span>: CID (動画の唯一の番号、動画アドレス番号に対応するの動画アドレスは複数の動画を含み得る)\n- <span>lid</span>: 配信ルーム番号\n- <span>y</span>/<span>M</span>/<span>d</span>: 年/月/日\n- <span>h</span>/<span>m</span>/<span>s</span>/<span>ms</span>: 時間/分/秒/ミリ秒\n\nデフォルトの命名形式は<span>[title][ - ep]</span>、動画のタイトル+エピソードタイトル、エピソードタイトルがない場合は動画のタイトルを表示する.\n\n変数は角括弧内に配置され、角括弧内のその他の内容は変数が有効な場合に表示されます. 例えば、命名形式が<span>[title] - [ep]</span>書かれている場合ではエピソードタイトルがなくても、この<span> - </span>ファイル名にも表示されます. デフォルトとして角括弧で囲まれている場合、エピソードタイトルがない、<span> - </span>が表示されません.\n\n例えば、タイトル＋AV番号＋時間の命名形式が欲しい、<span>[title][ AVaid] [y]-[M]-[d] [h]-[m]-[s]</span>に設定することができます. <span>xxxx AV23333 2019-06-1 22-22-22</span>ような名前をつけることができます.`],["sideBarOffset",`設定ボタンの垂直オフセット、単位はパーセント、許容範囲は-40％〜40％です.`],["useDefaultVideoSpeed",`デフォルトの再生速度を使用するかどうかを設定します.`],["defaultVideoSpeed",`デフォルトの動画再生速度を設定する.`],["autoDraw",`ライブルームに抽選活動がある場合は、「受け取り」ボタンを自動的にクリックします.\n    注意:少量の抽選にしか適用されますので、「99＋限定抽選」は他の人のスピードに追いつけないかもしれません.`],["ajaxHook",`「Ajax Hook API」を有効にするかどうか、他のプラグインまたは追加機能は、この「API」を通じて「Ajax」が要求する情報を取得できます.`],["scriptLoadingMode",`スクリプト機能読み込みモード:\n- 同時: Bilibiliのページと同時に読み込む\n- 延後: Bilibiliのページを優先的に読み込み、元のページの読み込みが完了したらスクリプトの読み込みを開始します\n- 同時(自動): さまざまなページに従って読み込みモードを自動的に選択します．デフォルトは「同時」モード\n- 延後(自動): さまざまなページに従って読み込みモードを自動的に選択します．デフォルトは「延後」モード`],[`fullActivityContent`,`情報内容がどれぐらい長いにも関わらず、いつも完全な内容を展開します.`],[`activityImageSaver`,`大きなフィード画像を右クリックすると、画像付きのメッセージがポップアップ表示され、簡単に保存できます.`],[`selectableColumnText`,`コラムのテキストを選択可能にする.`],[`watchlaterExpireWarnings`,`「後で見る」の動画は、追加後60日で有効期限が切れます.この機能を開くと、14日より後のリストに有効期限の警告が表示されます.`],[`miniPlayerTouchMove`,`ミニプレーヤーをタッチしてドラッグする.`],[`feedsFilter`,`タイプまたはキーワードでフィードホームページの内容をフィルタリングするか、フィードページのいくつかのサイドカードを削除します. ご注意ください：今、「すべてのフィード」でのみ有効にする、別のカテゴリに切り替える場合は無効.`],[`hideBangumiSponsors`,`番組ページの下のスポンサーランクと右側のスポンサーボタンを隠す.`],[`hideRecommendLive`,`動画ページ右側のおすすめ生放送を隠す.`],[`hideRelatedVideos`,`番組と動画ページ右側のおすすめ動画を隠す.`],[`simplifyHome`,`ホームページを置き換えます.2つのスタイルがあります:\n- さわやか: レイアウトは元のホームページに似ており、フィードセクションが追加されています.\n- ミニマル: 他のすべてのセクションを削除し、動画フィードと人気動画のみを残します.`],[`autoMatchMedal`,`今の配信ルームの勲章を持っている場合は、自動的にそれを着用します.それ以外の場合は、最後に手動で選択した勲章を着用します.`],[`urlParamsClean`,`冗長な追跡パラメーターをリンクから自動的に削除します.`],[`collapseLiveSideBar`,`生放送のサイドカードを自動的に収めます.`],[`batchFilenameFormat`,`バッチダウンロードファイルの命名形式をカスタマイズする、ルールは単一<span>文件命名格式</span>と同じです.\n新しい変数:\n- <span>n</span>: 番号、n番目の動画を意味します.`],[`removeGameMatchModule`,`電子スポーツプレート区を削除.`],[`recordLiveDanmaku`,`追加機能に生放送弾幕レコーダーを追加し、生放送弾幕を記録して「XML」をエクスポートできます.`],[`feedsTranslate`,`フィードごとの下に翻訳ボタンを追加して、フィード内容を中国語に翻訳します.「UI 翻訳」がオンになっている場合、「UI 翻訳」で設定された言語に翻訳されます.`],[`feedsTranslateProvider`,`機械翻訳の提供者`],[`updateCdn`,`ホットアップデートのアップデートソース、オフラインバージョンとスクリプト本体アップデートには無効.`],[`preserveEventBanner`,`動画ページの活動バナーを保持.`],[`useDefaultLiveQuality`,`デフォルトのライブ画質を使用するかどうかを制御します.デフォルトのライブ画質は検出され、配信ルームに入ると設定された画質に自動的に変更されます.`],[`defaultLiveQuality`,`デフォルトのライブ画質を選択します.`],[`fixedSidebars`,`フィードホームページの頂欄とサイドカードを強制的に固定します.フィードフィルターの固定解除効果よりも優先度が高く、高速プルによるジッターを回避できます.`],[`extendFeedsLive`,`フィードページの<span>配信中</span>で、生放送情報にタイトルを追加し、10個を超える生放送ルーム情報を表示できます.`],[`playerOnTop`,`動画ページのプレーヤーを上に表示すると、タイトル/ UPメッセージなどの情報が下に移動します.`],[`preferAvUrl`,`動画のリンクがBV番号の場合、自動的にAV番号に変換されます.`],[`elegantScrollbar`,`薄いスクロールバーを使用してシステムのデフォルトのスクロールバーを置き換える. (無効な夜間モード)`],[`quickFavorite`,`すばやくのお気に入りを有効にし、動画ページで、1つのキーでお気に入りを特定のお気に入りセットに追加できます.`],[`darkColorScheme`,`夜間モードでシステムが設定した「明るい/暗いテーマ」を同期させる.`],[`disableFeedsDetails`,`フィードページをクリックして詳細ページにジャンプすることは禁止されています.これはテキストを選択するのに便利です.`],[`danmakuSendBar`,`生放送ページの全画面モードとウェブの全画面モードでは、弾幕欄が下部に表示されます.`],[`watchLaterRedirectNavbar`,`頂欄の「後で見る」リンクをリダイレクトします.`],[`watchLaterRedirectPage`,`「後で見る」ページのリンクをリダイレクトします.`],[`showCoverBeforePlay`,`動画の再生が始まる前に、プレーヤーにサムネイルを表示します.`],[`customNavbarGlobalFixed`,`頂欄は、カスタム頂欄を使用するすべてのページで固定されているため、スクロールの影響を受けません.`],[`seoJump`,`SEOページに入ると、自動的に元の動画ページに戻ります.`],[`copyFeedsLink`,`フィードメニューにリンクのコピーオプションを追加する.`],[`copyCommentLink`,`コメントメニューにリンクのコピーオプションを追加する.`],[`unfoldFeeds`,`折りたたまれたフィードを自動的に展開する.`],[`commentsTranslate`,`コメントの翻訳ボタンを追加する.`],[`simpleHomeWheelScroll`,`水平カードリストでは、マウスホイールを上下にスクロールできると、このリストの水平スクロールになります.（シミュレートされているため、少し動かなくなる可能性があります）`],["airborne",`動画の時点が弾幕に表示されると、下線が表示されます.クリックして、対応する時点に直接移動します.`],[`downloadPackageEmitMode`,`複数のファイルのダウンロードを選択する場合の動作は、パッケージが zip にヒットしてダウンロードされ.個別にダウンロードされると、各ファイルのダウンロードがトリガーされます.`],[`columnImageExporter`,`コラムページでは、追加機能ですべての画像をエクスポートできます.`],[`feedsImageExporter`,`フィードの右上隅にあるメニューから画像をエクスポートして、このフィード内のすべての画像をダウンロードすることができます.`]]);return{export:{toolTips:n}}})();